var title_f2_1_2078="Stroke rates AF risk category";
var content_f2_1_2078=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F82291&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F82291&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 486px\">",
"   <div class=\"ttl\">",
"    Rate of ischemic stroke is related to risk category",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 274px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The incidence of a stroke in patients with either intermittent or sustained atrial fibrillation (AF) is related to risk category; the patients were treated with aspirin and followed for a mean of two years. Among those with intermittent AF, 24 percent were high risk, 32 percent are moderate risk and 43 percent are low risk; among those with sustaind AF, the respective values were 30, 34, and 36 percent. The stroke risk was similar in patients with intermittent and sustained AF.",
"    <div class=\"footnotes\">",
"     High risk: any of the following - age &gt;75 and hypertension, age &gt;75 and female, systolic BP &gt;160 mm Hg, prior stroke or transient ischemic attack; Moderate risk: either of - hypertension and age &le;75 or diabetes and no high risk features; Low risk: no moderate or high risk features.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Hart RG, Pearce LA, Rothbart RM, et al. J Am Coll Cardiol 2000; 35:183.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
